import React from "react";
import "./VehiclesList.css";

const vehicles = [
  { number: "KA-01-A-1234", color: "Red", location: "Sulphur, LA" },
  { number: "KA-05-B-5678", color: "Blue", location: "Tacoma, WA" },
  // Add more vehicles as necessary
];

const VehiclesList = () => {
  return (
    <div className="vehicles-list">
      {vehicles.map((vehicle, index) => (
        <div className="vehicle-item" key={index}>
          <p>{vehicle.number}</p>
          <p>{vehicle.color}</p>
          <p>{vehicle.location}</p>
        </div>
      ))}
    </div>
  );
};

export default VehiclesList;
